:text: |
  FAMILY STATISTICS
  The following table shows the growth of the family in each principal family line and by generation. Each of the children of Henry and Marianne are indicated by an alpha code
  commencing with “A” and William and Jane's children have codes commencing with “B”. The totals for each of the principal families are in the columns headed “A” and “B”.
  The first row contains the numbers of grandchildren of Henry and William in each family line. The great grandchildren are in row 2, great-great grandchildren in row 3, and so on.
  Row 7 contains the total number of descendants to date in each family line and row 8 is the total number of spouses. Note that columns AC and BA are duplicated in that they refer
  to the same family, that of Henry’s son Samuel and William's daughter Mary. Likewise, columns AD and BB are also duplicated, being Henry's son Henry and William's daughter
  Jane Elizabeth.
